import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './App.css';
import DoneRecipes from './pages/DoneRecipes';
import Favorites from './pages/Favorites';
import Login from './pages/Login';
import Profile from './pages/Profile';
import RecipeInProgressDrink from './pages/RecipeInProgressDrink';
import RecipeInProgressMeals from './pages/RecipeInProgressMeals';
import Recipes from './pages/Recipes';
import RecipesDetailsDrink from './pages/RecipesDetailsDrink';
import RecipesDetailsMeals from './pages/RecipesDetailsMeals';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route
          exact
          path="/"
          component={ Login }
        />

        <Route
          exact
          path="/meals"
          component={ Recipes }
        />

        <Route
          exact
          path="/meals/:id"
          component={ RecipesDetailsMeals }
        />

        <Route
          exact
          path="/drinks"
          component={ Recipes }
        />

        <Route
          exact
          path="/drinks/:id"
          component={ RecipesDetailsDrink }
        />

        <Route
          exact
          path="/favorite-recipes"
          component={ Favorites }
        />

        <Route
          exact
          path="/profile"
          component={ Profile }
        />

        <Route
          exact
          path="/meals/:id-da-receita/in-progress"
          component={ RecipeInProgressMeals }
        />

        <Route
          exact
          path="/drinks/:id-da-receita/in-progress"
          component={ RecipeInProgressDrink }
        />

        <Route
          exact
          path="/done-recipes"
          component={ DoneRecipes }
        />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
